import React from "react";
import styled from "styled-components";

const FilterToggleLink = styled.li`
  /* position: relative; */
  /* top: 20%; */
  border: none;
  cursor: pointer;
`;

export default function FilterToggle() {
  return <FilterToggleLink></FilterToggleLink>;
}
